import { LoginForm } from "./LoginForm";
import { Banner } from "./Banner";

const Login = ({ admin }) => {
    return (
        <UserContext.Provider value="change value in provider component">
            <div className="w-screen h-full bg-white-100 flex justify-center items-center">
                <div className="w-156 h-96 flex shadow-lg shadow-grey-200">
                    <LoginForm adminLogin={admin ? true : false} />
                    <Banner adminLogin={admin ? true : false} />
                </div>
            </div>
        </UserContext.Provider>
    );
};

export { Login };
